import React from "react"
import Console from "./Console/Console";

const App = props =>{

    return (
        <Container className="layout container-xl" >
            <Console/>
        <Row>
          <Col>
            <Search/>
            <PlayList/>
          </Col>
        </Row>
      </Container>
    )
}


export default App;
